import React, { useState } from 'react';
import { TextField, Button, Box, Container, Typography, MenuItem, Tooltip } from '@mui/material';
import ErrorIcon from '@mui/icons-material/Error';

const securityQuestions = [
  'What was your childhood nickname?',
  'What is the name of your favorite childhood friend?',
  'What was your favorite place to visit as a child?',
  'What was your dream job as a child?',
];

const Register = () => {
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [passwordError, setPasswordError] = useState(false);

  const handleSubmit = (event) => {
    event.preventDefault();
    if (password !== confirmPassword) {
      setPasswordError(true);
      return;
    }
    setPasswordError(false);
    // 在这里处理注册逻辑
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          marginTop: 15,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Typography component="h1" variant="h5">
          Register
        </Typography>
        <Box component="form" onSubmit={handleSubmit} sx={{ mt: 1 }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="username"
            label="Username"
            name="username"
            autoComplete="username"
            autoFocus
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="new-password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            error={passwordError}
          />
          <Box sx={{ display: 'flex', alignItems: 'center', width: '100%' }}>
            <TextField
              margin="normal"
              required
              fullWidth
              name="confirmPassword"
              label="Confirm Password"
              type="password"
              id="confirmPassword"
              autoComplete="new-password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              error={passwordError}
            />
            {passwordError && (
              <Tooltip title="Passwords do not match" placement="right">
                <ErrorIcon color="error" sx={{ ml: 1 }} />
              </Tooltip>
            )}
          </Box>
          <TextField
            margin="normal"
            required
            fullWidth
            id="securityQuestion"
            select
            label="Security Question"
            name="securityQuestion"
            autoComplete="security-question"
          >
            {securityQuestions.map((question, index) => (
              <MenuItem key={index} value={question}>
                {question}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            margin="normal"
            required
            fullWidth
            id="answer"
            label="Answer"
            name="answer"
            autoComplete="answer"
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2, backgroundColor: '#6EA8DD' }}
          >
            Register
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default Register;
